import { Link } from "react-router-dom";

export default function Nav() {
  return (
    <div className="nav">
      <img src="../../../../cooking.png" alt="icon" />
      <h1>Henry Food</h1>
      <select name="links" id="links">
        <option value="home">
          <Link to="/">Home</Link>
        </option>
        <option value="details">details</option>
        <option value="create">create</option>
      </select>
    </div>
  );
}
